import React, { Component } from 'react';

class Layout extends Component {

    render() {
        return (
            <div id="main">
                <header>
                    <a href="/" >Home</a>
                    <a href="/register" >Register</a>
                    <a href="/login" >Login</a>    
                </header>
                
                {this.props.children}
            </div>
        )
    }

}

export default Layout;
